            userService.deleteData('/applicationuser', toDelete);
          } else {
            console.log("Cancelled");
          }
    }

    renderPeopleTable(people) {
        return(
            <div>
            <Link to="/"><button className={"btn btn-link"}>Tilbake til søkesiden</button></Link>
            <h1 id="tabelLabel" >Søkeresultat</h1>
            <h2>Antall: {people.length}</h2>
            <p>Personer med angitt info.</p>
            <table className='table table-striped' aria-labelledby="tabelLabel">
              <thead>
                <tr>
                  <th>Seq</th>
                  <th>Fornavn</th>
                  <th>Etternavn</th>
                  <th>Alder</th>
                  <th>Gate</th>
                  <th>By</th>
                  <th>Stat</th>
                  <th>Lengdegrad</th>
                  <th>Breddegrad</th>
                  <th>CC-nummer</th>
                </tr>
              </thead>
              <tbody>
                      {people.map(people => 
                         <tr className="tableR"> 
                             <td>{people.seq}</td>
                              <td>{people.firstname}</td>
                              <td>{people.lastname}</td>
                              <td>{people.age}</td>
                              <td>{people.street}</td>
                              <td>{people.city}</td>
                              <td>{people.state}</td>
                              <td>{people.longitude}</td>
                              <td>{people.latitude}</td>
                              <td>{people.ccnumber}</td>
                              <td onClick={e => e.stopPropagation()}><button className={"btn btn-info"} onClick={() => this.confirmDeletePerson(people.seq)}>Slett</button></td>
                          </tr>
                )}
              </tbody>
            </table>
            </div>
        );
    }

    render() {
        let contents;
            contents = this.state.loading
            ? <p><em>Loading...</em></p>
            : this.renderPeopleTable(this.state.people);
            return(
                <div>
                    {contents}
            </div>
      );
    }
}
